import {useState, useEffect} from 'react';
import axios from 'axios';


function onSubmit(){
    axios.post('http://localhost:5000/signupen',res.data)
            .then(res => console.log(res.data));
}

function Form(){

    useEffect(() => {
        console.log("Use Effect Processed!");
    });

    const [name,setName]=useState("");
    const [email,setEmail]=useState("");
    const [mobile,setMobile]=useState("");
    const [password,setPassword]=useState("");

    return(

        <div>
            <br></br>

            <center>
            <form>
                <label for="fname">Name: </label>
                <input type = "text" placeholder="Enter Name" value={name} onChange={(e)=> setName(e.target.value)}></input><br/><br/>
                <label for="fname">Email: </label>
                <input type = "text" placeholder="Enter Email" value={email} onChange={(e)=> setEmail(e.target.value)}></input><br/><br/>
                <label for="fname">Contact: </label>
                <input type = "text" placeholder="Enter Number" value={mobile} onChange={(e)=> setMobile(e.target.value)}></input><br/><br/>
                <label for="fname">Password: </label>
                <input type = "password" placeholder="Enter Password" value={password} onChange={(e)=> setPassword(e.target.value)}></input><br/><br/>
                <button onclick="onSubmit()">Submit</button>
            </form>    
                
            </center>
            

        </div>
    )
}

export default Form
